import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";import{o as a,c as h,d as r}from"./app.bc89c0d1.js";const i={},d=r('<h1 id="\u96C6\u5408" tabindex="-1"><a class="header-anchor" href="#\u96C6\u5408" aria-hidden="true">#</a> \u96C6\u5408</h1><blockquote><p>\u96C6\u5408\u662F\u6211\u4EEC\u65E5\u5E38\u5F00\u53D1\u4E2D\u6700\u5E38\u7528\u7684\u5BF9\u8C61\uFF0C\u96C6\u5408\u662F\u53EF\u4EE5\u5BB9\u7EB3 Java \u5BF9\u8C61\u7684\u5BF9\u8C61\uFF0C\u4FBF\u5229\u3001\u7B80\u5355\u662F\u5B83\u6700\u5927\u7684\u4F18\u70B9</p></blockquote><h2 id="\u6982\u5FF5" tabindex="-1"><a class="header-anchor" href="#\u6982\u5FF5" aria-hidden="true">#</a> \u6982\u5FF5</h2><p>\u5F53\u6211\u4EEC\u521A\u5165\u95E8\u5B66\u4E60 Java \u65F6\uFF0C\u7B2C\u4E00\u4E2A\u63A5\u89E6\u7684\u6570\u636E\u7ED3\u6784\u5E94\u8BE5\u662F\u6570\u7EC4\uFF0C\u6570\u7EC4\u662F\u5B58\u653E\u4E00\u7EC4\u76F8\u540C\u7C7B\u578B\u5BF9\u8C61\u7684\u5BB9\u5668\uFF0C\u7136\u800C\u6211\u4EEC\u5B66\u4E60\u6570\u7EC4\u65F6\u53EF\u4EE5\u53D1\u73B0\uFF0C\u5143\u7D20\u7684\u5B58\u53D6\u90FD\u4E0D\u662F\u901A\u8FC7\u6570\u7EC4\u81EA\u5DF1\u7684 API \u5B9E\u73B0\uFF0C\u800C\u662F\u901A\u8FC7\u7D22\u5F15\u8FDB\u884C\u8BBF\u95EE\u3002</p><p>\u7531\u4E8E\u6570\u7EC4\u4F7F\u7528\u8D77\u6765\u4E0D\u65B9\u4FBF\uFF0C\u4E14\u53EA\u80FD\u8868\u793A\u4E00\u79CD\u7EBF\u6027\u5E8F\u5217\u7684\u7ED3\u6784\uFF0C\u6240\u4EE5 Java \u63A8\u51FA\u4E86\u96C6\u5408\u8FD9\u4E00\u7C7B\u6570\u636E\u7ED3\u6784\uFF0C\u6781\u5927\u5730\u964D\u4F4E\u6570\u636E\u64CD\u4F5C\u96BE\u5EA6\uFF0C\u8FD8\u5E26\u6765\u4E86\u53CC\u5217\u7ED3\u6784\u7684\u96C6\u5408\uFF0C\u800C\u4E14\u53EF\u4EE5\u4F7F\u7528\u9762\u5411\u5BF9\u8C61\u7684\u65B9\u5F0F\u8FDB\u884C\u5F00\u53D1\uFF0C\u53EF\u4EE5\u8BF4\u662F\u4E00\u6B21\u6280\u672F\u7684\u9769\u65B0\uFF01</p><p>Java \u4E2D\u7684\u96C6\u5408\u4E3B\u8981\u5305\u542B\u4E24\u5927\u7C7B\uFF1ACollection \u548C Map\uFF0C\u5F15\u7528\u4E00\u4E0B\u7F51\u4E0A\u5927\u795E\u96C6\u5408\u7684\u67B6\u6784\u56FE~</p><p><img src="https://wingbun-notes-image.oss-cn-guangzhou.aliyuncs.com/images/20220312194155.png" alt=""></p><h2 id="collection" tabindex="-1"><a class="header-anchor" href="#collection" aria-hidden="true">#</a> Collection</h2><blockquote><p>Collection \u662F\u5355\u5217\u96C6\u5408\uFF0C\u4E5F\u5C31\u662F\u8BF4\u96C6\u5408\u4E2D\u7684\u4E00\u4E2A\u7A7A\u95F4\u53EA\u5B58\u50A8\u4E00\u4E2A\u5BF9\u8C61\uFF0C\u6BD4\u8F83\u6709\u4EE3\u8868\u6027\u7684\u5B9E\u73B0\u6709Set\u3001List\u3001Queue</p></blockquote><h3 id="set" tabindex="-1"><a class="header-anchor" href="#set" aria-hidden="true">#</a> Set</h3><p>\u7279\u70B9\uFF1A\u96C6\u5408\u4E2D\u7684\u5143\u7D20\u662F\u552F\u4E00\u7684</p><h4 id="hashset" tabindex="-1"><a class="header-anchor" href="#hashset" aria-hidden="true">#</a> HashSet</h4><p>Set \u7684\u5E38\u7528\u5B9E\u73B0\u7C7B\uFF0C\u57FA\u4E8E\u54C8\u5E0C\u8868\u5B9E\u73B0\uFF0C\u652F\u6301\u5FEB\u901F\u67E5\u627E\uFF0C\u4F46\u4E0D\u652F\u6301\u6709\u5E8F\u6027\u64CD\u4F5C\u3002\u5E76\u4E14<strong>\u5931\u53BB\u4E86\u5143\u7D20\u7684\u63D2\u5165\u987A\u5E8F\u4FE1\u606F</strong>\uFF0C\u4E5F\u5C31\u662F\u8BF4\u4F7F\u7528 Iterator \u904D\u5386 HashSet \u5F97\u5230\u7684\u7ED3\u679C\u662F\u4E0D\u786E\u5B9A\u7684\u3002</p><h4 id="linkedhashset" tabindex="-1"><a class="header-anchor" href="#linkedhashset" aria-hidden="true">#</a> LinkedHashSet</h4><p>\u9664\u4E86\u5177\u6709 HashSet \u7684\u67E5\u627E\u6548\u7387\uFF0C\u5E76\u4E14\u5185\u90E8<strong>\u4F7F\u7528\u53CC\u5411\u94FE\u8868\u7EF4\u62A4\u5143\u7D20\u7684\u63D2\u5165\u987A\u5E8F</strong>\u3002</p><h4 id="treeset" tabindex="-1"><a class="header-anchor" href="#treeset" aria-hidden="true">#</a> TreeSet</h4><p>\u57FA\u4E8E\u7EA2\u9ED1\u6811\u5B9E\u73B0\uFF0C\u652F\u6301\u6709\u5E8F\u6027\u64CD\u4F5C\uFF0C\u4F8B\u5982\u6839\u636E\u4E00\u4E2A\u8303\u56F4\u67E5\u627E\u5143\u7D20\u7684\u64CD\u4F5C\u3002\u4F46\u662F\u67E5\u627E\u6548\u7387\u4E0D\u5982 HashSet\uFF0CHashSet \u67E5\u627E\u7684\u65F6\u95F4\u590D\u6742\u5EA6\u4E3A O(1)\uFF0CTreeSet \u5219\u4E3A O(logN)\u3002</p><h3 id="list" tabindex="-1"><a class="header-anchor" href="#list" aria-hidden="true">#</a> List</h3><p>\u6709\u7D22\u5F15\u3001\u6709\u987A\u5E8F\u7684\u96C6\u5408\uFF0C\u5141\u8BB8\u5B58\u50A8\u91CD\u590D\u7684\u5143\u7D20</p><h4 id="arraylist" tabindex="-1"><a class="header-anchor" href="#arraylist" aria-hidden="true">#</a> ArrayList</h4><p>\u57FA\u4E8E\u6570\u7EC4\u53CA\u52A8\u6001\u6269\u5BB9\u7684\u673A\u5236\u5B9E\u73B0\uFF0C\u5141\u8BB8\u968F\u673A\u8BBF\u95EE\u3002</p><h4 id="linkedlist" tabindex="-1"><a class="header-anchor" href="#linkedlist" aria-hidden="true">#</a> LinkedList</h4><p>\u57FA\u4E8E\u53CC\u5411\u94FE\u8868\u5B9E\u73B0\uFF0C\u53EA\u80FD\u987A\u5E8F\u8BBF\u95EE\uFF0C\u4F46\u53EF\u4EE5\u65B9\u4FBF\u5730\u5728\u96C6\u5408\u4E2D\u95F4\u589E\u5220\u5143\u7D20\u3002LinkedList \u53EF\u4EE5\u7528\u4F5C\u6808\u3001\u961F\u5217\u7684\u5177\u4F53\u5B9E\u73B0\u3002</p><h4 id="vector" tabindex="-1"><a class="header-anchor" href="#vector" aria-hidden="true">#</a> Vector</h4><p>\u4E0E ArrayList \u539F\u7406\u7C7B\u4F3C\uFF0C\u4F46\u662F\u662F\u7EBF\u7A0B\u5B89\u5168\u7684\u3002</p><h3 id="queue" tabindex="-1"><a class="header-anchor" href="#queue" aria-hidden="true">#</a> Queue</h3><p>Queue \u63A5\u53E3\u5B9A\u4E49\u4E86\u961F\u5217\u6570\u636E\u7ED3\u6784\uFF0C\u5143\u7D20\u662F\u6709\u5E8F\u7684(\u6309\u63D2\u5165\u987A\u5E8F)\uFF0C\u5148\u8FDB\u5148\u51FA</p><h4 id="priorityqueue" tabindex="-1"><a class="header-anchor" href="#priorityqueue" aria-hidden="true">#</a> PriorityQueue</h4><p>\u4F18\u5148\u961F\u5217\uFF0C\u5E95\u5C42\u4F7F\u7528\u6570\u7EC4\u5B9E\u73B0\u4E86\u5806\u7684\u7ED3\u6784\u3002\u548C\u666E\u901A\u7684\u961F\u5217\u7684 FIFO \u7279\u6027\u4E0D\u540C\uFF0C\u4F18\u5148\u961F\u5217\u5185\u90E8\u7EF4\u62A4\u7740\u4E00\u4E2A\u5806\uFF0C\u6BCF\u6B21\u53D6\u6570\u636E\u7684\u65F6\u5019\u90FD\u4ECE\u5806\u9876\u62FF\u6570\u636E\uFF08\u5806\u9876\u7684\u4F18\u5148\u7EA7\u6700\u9AD8\uFF09\u3002\u6BCF\u6B21\u96C6\u5408\u4E2D\u6709\u6570\u636E\u6DFB\u52A0\u6216\u5220\u9664\u7684\u65F6\u5019\u90FD\u4F1A\u5BF9\u5806\u8FDB\u884C\u8C03\u6574\u3002</p><h4 id="deque" tabindex="-1"><a class="header-anchor" href="#deque" aria-hidden="true">#</a> Deque</h4><p>Deque (Double-ended queue) \u662F\u4E00\u4E2A\u7EE7\u627F\u4E86 Queue \u7684\u5B50\u63A5\u53E3\uFF0C\u53EF\u4EE5\u521B\u5EFA\u53CC\u5411\u961F\u5217\uFF0C\u7075\u6D3B\u6027\u66F4\u5F3A\uFF0C\u53EF\u4EE5\u524D\u5411\u6216\u540E\u5411\u8FED\u4EE3\uFF0C\u5728\u961F\u5934\u961F\u5C3E\u5747\u53EF\u63D2\u5165\u6216\u5220\u9664\u5143\u7D20\u3002\u5B83\u7684\u4E24\u4E2A\u4E3B\u8981\u5B9E\u73B0\u7C7B\u662F ArrayDeque \u548C LinkedList\u3002</p><h5 id="arraydeque" tabindex="-1"><a class="header-anchor" href="#arraydeque" aria-hidden="true">#</a> ArrayDeque</h5><p>\u5B9E\u73B0\u4E86 DeQueue \u63A5\u53E3\uFF0C\u53CC\u5411\u961F\u5217\uFF0C\u5E95\u5C42\u662F\u7528\u5FAA\u73AF\u6570\u7EC4\u5B9E\u73B0\u3002\u867D\u7136 Java \u6709\u63D0\u4F9B\u6808\u7684\u6570\u636E\u7ED3\u6784\uFF0C\u4F46\u662F\u5F00\u53D1\u4E2D\u4E00\u822C\u4F7F\u7528 ArrayDeque \u8FDB\u884C\u6808\u529F\u80FD\u7684\u5B9E\u73B0\uFF0C\u66F4\u9AD8\u6548\u3002</p><h2 id="map" tabindex="-1"><a class="header-anchor" href="#map" aria-hidden="true">#</a> Map</h2><blockquote><p>Map \u662F\u53CC\u5217\u96C6\u5408\uFF0C\u96C6\u5408\u4E2D\u4E00\u4E2A\u7A7A\u95F4\u5B58\u50A8\u7740\u4E00\u4E2A\u952E\u503C\u5BF9(\u4E24\u4E2A\u5BF9\u8C61)\uFF0C\u6BD4\u8F83\u6709\u4EE3\u8868\u6027\u7684\u5B9E\u73B0\u6709HashMap</p></blockquote><h3 id="hashmap" tabindex="-1"><a class="header-anchor" href="#hashmap" aria-hidden="true">#</a> HashMap</h3><p>\u57FA\u4E8E\u4E00\u4E2A\u54C8\u5E0C\u8868\u6765\u5B9E\u73B0\u952E\u503C\u5BF9\u7684\u5B58\u50A8\uFF0C\u4F46\u662F\u5143\u7D20\u662F\u65E0\u5E8F\u7684\u3002</p><h3 id="linkedhashmap" tabindex="-1"><a class="header-anchor" href="#linkedhashmap" aria-hidden="true">#</a> LinkedHashMap</h3><p>\u5728 HashMap \u7684\u57FA\u7840\u4E0A\uFF0C\u4F7F\u7528\u53CC\u5411\u94FE\u8868\u6765\u7EF4\u62A4\u5143\u7D20\u7684\u987A\u5E8F\uFF0C\u987A\u5E8F\u4E3A\u63D2\u5165\u987A\u5E8F\u6216\u8005\u6700\u8FD1\u6700\u5C11\u4F7F\u7528(LRU)\u987A\u5E8F\u3002</p><h3 id="hashtable" tabindex="-1"><a class="header-anchor" href="#hashtable" aria-hidden="true">#</a> HashTable</h3><p>\u548C HashMap \u7684\u529F\u80FD\u7C7B\u4F3C\uFF0C\u4F46\u662F\u662F\u7EBF\u7A0B\u5B89\u5168\u7684\u3002\u4E0D\u8FC7\u73B0\u5728\u5DF2\u7ECF\u4E0D\u63A8\u8350\u4F7F\u7528\u5B83\u4E86\uFF0C\u56E0\u4E3A\u5B83\u91CC\u9762\u5927\u90E8\u5206\u65B9\u6CD5\u90FD\u662F\u4F7F\u7528\u4E86 <code>synchronized</code> \u4FEE\u9970\uFF0C\u6027\u80FD\u4E0D\u9AD8\u3002\u63A8\u8350\u4F7F\u7528 ConcurrentHashMap \u6765\u652F\u6301\u7EBF\u7A0B\u5B89\u5168\uFF0C\u56E0\u4E3A\u5185\u90E8\u4F7F\u7528\u4E86\u5206\u6BB5\u9501\uFF0C\u6027\u80FD\u66F4\u9AD8\u3002</p><h3 id="treemap" tabindex="-1"><a class="header-anchor" href="#treemap" aria-hidden="true">#</a> TreeMap</h3><p>\u57FA\u4E8E\u7EA2\u9ED1\u6811\u5B9E\u73B0\u952E\u503C\u5BF9\u7684\u5B58\u50A8\u3002</p>',43),t=[d];function s(n,c){return a(),h("div",null,t)}var u=e(i,[["render",s],["__file","\u603B\u89C8.html.vue"]]);export{u as default};
